import React from 'react';
import './index.css';


function Blog({items}){

    const direction = (index, item) => {
        if(index%2 === 0){
            return(
                <div>
                    <img src={item.pic}/>
                    {item.title}
                </div>
            );
        }
        else{
            return(
                <div>
                    {item.title}
                    <img src={item.pic}/>
                </div>
            );
        }
    }

    return(
        <div className='blocks'>
            
            { items && items.map( (item, index) => (
                <div className={index%2 === 0 ? 'item1' : 'item2'} key={`${item}_${index}`}>
                    {direction(index, item)}
                </div>
            ))
            }
        </div> 
        );
}


export default Blog;
